import React from 'react';
import { Link } from 'react-router-dom';
import MainLayout from './layout/MainLayout';
import './NotFound.css';

const NotFound = () => {
  return (
    <MainLayout userType="guest" showContainer={true} pageTitle="Page Not Found">
      <div className="not-found-container">
        <div className="not-found-content">
          <div className="not-found-icon">404</div>
          <h1>Oops! Page Not Found</h1>
          <p>The page you are looking for might have been removed, had its name changed, or is temporarily unavailable.</p>
          
          <div className="not-found-actions">
            <Link to="/" className="btn btn-primary">
              <span className="btn-icon">üè†</span> Go to Homepage
            </Link>
            <Link to="/vendi/all-products" className="btn btn-outline">
              <span className="btn-icon">üõçÔ∏è</span> Browse Products
            </Link>
          </div>
          
          <div className="not-found-help">
            <h3>Looking for something specific?</h3>
            <ul className="quick-links">
              <li><Link to="/vendi/all-products">All Products</Link></li>
              <li><Link to="/vendor/register">Become a Vendor</Link></li>
              <li><Link to="/contact">Contact Support</Link></li>
              <li><Link to="/about">About MarketConnect</Link></li>
            </ul>
          </div>
        </div>
      </div>
    </MainLayout>
  );
};

export default NotFound;
